INSERT INTO `cladding` VALUES (28,'Oak','Oak is the most widely used hardwood. There are more than 60 species of oak grown in the U.S., which can be separated into two basic varieties; white and red. The red variety is also known as black oak (a reference to its bark).\r\n',23),(29,'Maple','There are 115 species of maple. Only 5 commercially important species grow in the U.S. Two of the five are hard rock maple and sugar maple.',3),(30,'Mahogany','Mahogany, also known as Honduras mahogany is a tropical hardwood indigenous to South America, Central America and Africa.',11),(31,'Walnut','Walnut is one of the most versatile and popular cabinet making woods. It grows in Europe, America and Asia. There are many different varieties.',3),(33,'Ash','There are 16 species of ash which grow in the eastern United States. Of these, the white ash is the largest and most commercially important.',1),(34,'Birch','There are many species of birch. The yellow birch is the most commercially important. European birch is fine grained, rare and expensive.',4),(35,'Teak','True teak is indigenous to Southeast Asia, but similar wood species also grow in Africa.',3),(36,'Pine','Pine is a softwood which grows in most areas of the Northern Hemisphere. There are more than 100 species worldwide. ',2),(37,'Cedar','Several species of cedar grow in the southern United States, Central and South America.\r\n\r\n',3),(38,'Redwood','Indigenous to the Pacific United States, redwood trees grow to more than 300 feet tall and 2,500 years old.',6),(39,'Hickory','There are 15 species of hickory in the eastern United States, eight of which are commercially important.',5);
